import logo from "../img/logo2.png";
import sun from "../img/weather-icons/sun.png";
import "../App.css";
import React from "react";
import { Link } from "react-router-dom";

function Main() {
  let exampleCity = (tab) => {
    //wykonuje zapytanie do api w funkcji
    return (
      <div id="exampleCity">
        {tab.map((item, index) => (
          <div key={index} className="App-panel2">
            <h3>{item}</h3>
            <div className="App-degree">
              <p>25&deg;C</p>
            </div>
            <div>
              <img src={sun} alt="sun" className="App-icon" />
            </div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <section>
      <div>
        <button class="unit-button active" onclick="switchUnit('C')">
          °C
        </button>
        <button class="unit-button" onclick="switchUnit('F')">
          °F
        </button>
      </div>
      <div id="searchPanel">
        <div className="App-panel">
          <h2>Search the wather</h2>
          <form method="GET">
            <input type="text" name="city" id="city" placeholder="city" />
            <input type="submit" value="Search" />
          </form>
        </div>
      </div>
      {exampleCity(["Warszawa", "Nowy York", "Londyn", "Paryż"])}
    </section>
  );
}

export default Main;
